function y = pdf(x,w,Mu,Sigma)

n = size(x,1);
y = zeros(n,1);
M = numel(w);
for m = 1:M
    y = y + w(m)*mvnpdf(x,Mu(m,:),squeeze(Sigma(m,:,:)));
end

end